import React from 'react';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './pages/Home';
import Login from './pages/Login';
import Registration from './pages/Registration';
import Search from './pages/Search';
import Cars from './pages/Cars';
import Profile from './pages/Profile';  // Importujeme stránku profilu
import axios from 'axios';
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js";
import { Routes, Route } from 'react-router-dom';
import PrivateRoute from './components/PrivateRoute';  // Importujeme PrivateRoute komponentu

// Nastavení axios pro připojení k backendu
axios.defaults.baseURL = 'http://localhost:3001';
axios.defaults.withCredentials = true;

function App() {
  return (
    <>
      <Navbar />
      <Routes>
        <Route path='/' element={<Home />} />
        <Route path='/registration' element={<Registration />} />
        <Route path='/login' element={<Login />} />
        <Route path='/search' element={<Search />} />
        <Route path='/cars' element={<Cars />} />
        {/* Použití PrivateRoute pro profil */}
        <PrivateRoute path='/profile' element={<Profile />} />
      </Routes>
      <Footer />
    </>
  );
}

export default App;
